import React from 'react';
import './App.css';
import { Route, Router, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route />
        </Routes> 
      </Router>
    </div>
  );
}

export default App;
